import React, { useState } from "react";
import { AreaChart, Area, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from "recharts";
import { ChartTooltip, LiveIndicator } from "../ui/Primitives";
import { COLORS } from "../../constants/tokens";
import { RefreshCw } from "lucide-react";

export default function LiveChart({ cpuData, memData, rpsData, onRefresh }) {
  const [tab, setTab] = useState("cpu");
  const data = { cpu: cpuData, mem: memData, rps: rpsData }[tab] ?? cpuData;
  return (
    <div className="panel slide-up">
      <div className="panel-header">
        <div className="panel-title">
          <span style={{ color: COLORS.cyan }}>◈</span>
          LIVE METRIC STREAM
          <span style={{ color: COLORS.muted, fontWeight: 400 }}>— system.{tab}.load.avg</span>
        </div>
        <div style={{ display:"flex", alignItems:"center", gap:8 }}>
          {["cpu","mem","rps"].map((t) => (
            <div key={t} className={`tab-item ${tab === t ? "active" : ""}`}
              style={{ padding:"0 10px", height:36, display:"flex", alignItems:"center" }}
              onClick={() => setTab(t)}>{t.toUpperCase()}</div>
          ))}
          <LiveIndicator />
          <button className="btn-ghost" onClick={onRefresh}><RefreshCw size={11} />REFRESH</button>
        </div>
      </div>
      <div style={{ padding:"12px 4px 8px" }}>
        <ResponsiveContainer width="100%" height={165}>
          <AreaChart data={data} margin={{ top:4, right:16, left:-10, bottom:0 }}>
            <defs>
              <linearGradient id="gC" x1="0" y1="0" x2="0" y2="1"><stop offset="5%"  stopColor={COLORS.cyan}  stopOpacity={0.18}/><stop offset="95%" stopColor={COLORS.cyan}  stopOpacity={0}/></linearGradient>
              <linearGradient id="gG" x1="0" y1="0" x2="0" y2="1"><stop offset="5%"  stopColor={COLORS.green} stopOpacity={0.12}/><stop offset="95%" stopColor={COLORS.green} stopOpacity={0}/></linearGradient>
            </defs>
            <CartesianGrid strokeDasharray="2 4" stroke="rgba(255,255,255,0.04)" />
            <XAxis dataKey="t" tick={{ fontFamily:"JetBrains Mono",fontSize:10,fill:COLORS.muted }} tickLine={false} axisLine={false} interval={4} />
            <YAxis tick={{ fontFamily:"JetBrains Mono",fontSize:10,fill:COLORS.muted }} tickLine={false} axisLine={false} domain={[0,100]} />
            <Tooltip content={<ChartTooltip />} />
            <Area type="monotone" dataKey="v"  name="Primary"   stroke={COLORS.cyan}  strokeWidth={1.5} fill="url(#gC)" dot={false} activeDot={{ r:4, fill:COLORS.cyan,  stroke:COLORS.void, strokeWidth:2 }} />
            <Area type="monotone" dataKey="v2" name="Secondary" stroke={COLORS.green} strokeWidth={1}   fill="url(#gG)" dot={false} activeDot={{ r:3, fill:COLORS.green }} />
          </AreaChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
}
